import React, { useEffect, useState } from "react";
import { getAllLaunchList } from "./Utility/Services/launch";
const SpaceLaunchList = () => {
  const [state, setState] = useState({ launchList: [] });
  useEffect(() => {
    getAllLaunchList().then((res) => {
      if (res.error) {
        return;
      }
      if (!res.error) {
        state.launchList = res.data;
        setState({ ...state });
      }
    });
  }, []);
  return (
    <>
      <div className="container-fluid">
        <div className="row">
          <div className="col-lg-4">Filter</div>
          <div className="col-lg-8">
            <div className="row">
              {state.launchList.map((res) => {
                return <div className="col-lg-3 border">
                    <div> <img src={res.links.mission_patch_small}/> </div>
                    <div> {res.mission_name}  </div>
                </div>;
              })}
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default SpaceLaunchList;
